import styled from 'styled-components';

const Form = styled.form`
  text-align: center;
`;

const EditCustomer = () => {
  const formSubmitHandler = e => {};

  return (
    <Form onSubmit={formSubmitHandler}>
      <div>
        <label>Name</label>
        <input></input>
        <label>Email</label>
        <input></input>
        <label>Channel</label>
        <input></input>
        <label>Address</label>
        <input></input>
        <label>Postal Code</label>
        <input></input>
        <label>City</label>
        <input></input>
        <label>Province</label>
        <input></input>
      </div>
    </Form>
  );
};

export default EditCustomer;
